import React, { Component, Fragment } from 'react';
import axios from 'axios';

class OrderHistory extends Component {

    constructor(props) {
        super(props);

        this.state = {
            order: []
        }
    }

    componentDidMount() {
        axios.get("/orderByMembershipId").then(response => {

            for (var i = 0 ; i < response.orders.length; i++){
                this.state.order.push(response.orders[i]);
            }
        })
        .catch(err => {
            console.log(err);
        });
    }

    render() {
        return (
            <Fragment>
                <table class="table">
                    {this.state.order}
                </table>
            </Fragment>
        )
    }
}


export default OrderHistory;
